definition.script:
pipeline {
    agent any

    stages {
        stage('Build') {
            steps {
	    checkout scmGit(branches: [[name: '*/main']], extensions: [], userRemoteConfigs: [[url: 'REDACTED://github.com/suki-aiagent/poc-java-app1.git']])
	    sh '''cd app
	    gradle build -x test'''
            }
        }
        stage('Test') {
            steps {
	            sh '''cd app
                gradle test'''
            }
            post {
                always {
                    // Publish JUnit reports
                    junit 'app/build/test-results/test/*.xml'
                }
            }
        }
    }
}
